from typing import *
import time


class TreeNode:
    def __init__(self, x):
        self.val = x
        self.left = None
        self.right = None

class Solution:
    def maximum69Number (self, num: int) -> int:
        ans = ''
        flag = True
        for s in str(num):
            if flag and s == '6':
                ans += '9'
                flag = False
                continue
            ans += s
        return int(ans)

    def printVertically(self, s: str) -> List[str]:
        s = s.split()
        ml = max(map(len,s))
        l = len(s)
        temp = ['' for _ in range(ml)]
        for i in range(ml):
            for j in range(l):
                if i < len(s[j]):
                    temp[i] += s[j][i]
                else:
                    temp[i] += ' '
        ans = []
        for a in temp:
            while a.endswith(' '):
                a = a[:-1]
            ans.append(a)
        return ans

    def removeLeafNodes(self, root: TreeNode, target: int) -> TreeNode:
        def dfs(node:TreeNode):
            if node is None:
                return None
            node.left = dfs(node.left)
            node.right = dfs(node.right)
            if node.left is None and node.right is None and node.val == target:
                return None
            return node
        return dfs(root)
    def minTaps(self, n: int, ranges: List[int]) -> int:
        covs = []
        for i in range(n+1):
            if ranges[i] == 0:
                continue
            l = i - ranges[i]
            r = i + ranges[i]
            l = l if l > 0 else 0
            r = r if r < n else n
            covs.append([l,r])
        if len(covs) == 0:
            return -1
        covs.sort(key=lambda x:x[1],reverse=True)
        covs.sort(key=lambda x:x[0],reverse=False)
        if covs[0][0] > 0:
            return -1
        cnt = 1
        now = covs[0][1]
        next_max = covs[0][1]
        for c in covs:
            if c[0] > next_max:
                return -1
            if c[0] > now:
                cnt+=1
                now = next_max
            next_max = max(next_max,c[1])

            if now == n:
                return cnt
        if next_max == n:
            return cnt+1
        return -1





